import { useState } from "react";

const initialFriends = [
  {
    id: 118836,
    name: "Clark",
    image: "https://i.pravatar.cc/48?u=118836",
    balance: -7,
  },
  {
    id: 933372,
    name: "Sarah",
    image: "https://i.pravatar.cc/48?u=933372",
    balance: 20,
  },
  {
    id: 499476,
    name: "Anthony",
    image: "https://i.pravatar.cc/48?u=499476",
    balance: 0,
  },
];
export default function App() {
  // const [addFriend, setAddFriend] = useState(true);

  return (
    <div className="app">
      <div className="sidebar">
        <FriendsList />
        <FormAddFriend />
        <Button> Add friend</Button>
      </div>
      <FormSplitBill />
    </div>
  );
}
function FriendsList() {
  const friends = initialFriends;
  return (
    <ul>
      {friends.map((each) => (
        <Friend friends={each} key={each.id} />
      ))}
    </ul>
  );
}
function Friend({ friends }) {
  return (
    <li>
      <img src={friends.image} alt={friends.name} />
      <h3>
        {}
        {friends.name}
      </h3>
      {friends.balance < 0 && (
        <p className="red">
          you owe {friends.name} {Math.abs(friends.balance)}
        </p>
      )}

      {friends.balance > 0 && (
        <p className="green">
          you owe {friends.name} {Math.abs(friends.balance)}
        </p>
      )}

      {friends.balance === 0 && <p>you and {friends.name} are even</p>}

      <Button> Select</Button>
    </li>
  );
}
function Button({ children }) {
  return <button className="button">{children}</button>;
}
function FormAddFriend() {
  // console.log(addFriend);
  return (
    <form className="form-add-friend">
      <label>üë≠Friendname</label>
      <input type="text" />

      <label>üñºÔ∏è Image URL</label>
      <input type="text" />
      <Button>Add</Button>
    </form>
  );
}
function FormSplitBill() {
  function handleaddfreind(e) {
    console.log(e.target.value);
  }
  return (
    <form className="form-split-bill">
      <h2> Split a bill with X</h2>

      <label>üí∞ Bill value</label>
      <input type="text" onChange={handleaddfreind} />

      <label>üßç‚Äç‚ôÇÔ∏è your expense</label>
      <input type="text" />

      <label>üë≠ X's expense</label>
      <input type="text" disabled />

      <label>ü§ë Who is paying the bill</label>
      <select>
        <option value={"user"}>You</option>
        <option value={"friend"}>X</option>
      </select>
      <Button>Split bill</Button>
    </form>
  );
}
